import React from 'react';

function Notify({ notify }) {
    console.log(notify);
    return (
        <div >
            <div className="fixed top-2 right-2 p-4  w-40 shadow-sm" >
                <p>Hello</p>
                <span className="bg-green-400 block h-2 w-full" ></span>
            </div>
        </div>
    );
}

export default Notify;
